import React from "react";

const NavBar = () => {
  return (
    <nav>
      <ul>
        <li>
          <button onClick={() => setPage("Dashboard")}>Inicio</button>
        </li>
        <li>
          <button onClick={() => setPage("Products")}>Productos</button>
        </li>
        <li>
          <button onClick={() => setPage("Users")}>Users</button>
        </li>
      </ul>
    </nav>
  );
};

export { NavBar };
